  const [Djokovic, setDjokovic] = useState(50);

  return (
    <>
    <div className="header">
      <div className="logo">
        <img src={logo} alt="logo" height="50px"/>
          Sentiment
      </div>
      <ConnectButton/>
    </div>
    <div className="instructions">
      Who do you think will win Wimbledon?
    </div>
    <Coin perc={Djokovic} setperc={setDjokovic} player="Djokovic"/>

    </>
  );
};

export default App;
